import re
from collections import defaultdict

def evaluate(inputValue):

    class Graph:
      def __init__(self):

          self.nodes = set()
          self.edges = defaultdict(list)
          self.weights = {}

      def add_node(self, value):
          self.nodes.add(value)

      def add_edge(self, from_node, to_node, weight):

          self.edges[from_node].append(to_node)
          # self.edges[to_node].append(from_node)
          self.weights[(from_node, to_node)] = weight

    def dijsktra(graph, initial, end):
    # shortest paths is a dict of nodes
    # whose value is a tuple of (previous node, weight)
        shortest_paths = {initial: (None, 0)}
        current_node = initial
        visited = set()

        while current_node != end:
            visited.add(current_node)
            destinations = graph.edges[current_node]
            weight_to_current_node = shortest_paths[current_node][1]

            for next_node in destinations:
                weight = graph.weights[(current_node, next_node)] + weight_to_current_node
                if next_node not in shortest_paths:
                    shortest_paths[next_node] = (current_node, weight)
                else:
                    current_shortest_weight = shortest_paths[next_node][1]
                    if current_shortest_weight > weight:
                        shortest_paths[next_node] = (current_node, weight)

            next_destinations = {node: shortest_paths[node] for node in shortest_paths if node not in visited}
            if not next_destinations:
                return None
            # next node is the destination with the lowest weight
            current_node = min(next_destinations, key=lambda k: next_destinations[k][1])

        # Work back through destinations in shortest path
        path = []
        while current_node is not None:
            path.append(current_node)
            next_node = shortest_paths[current_node][0]
            current_node = next_node
        # Reverse path
        path = path[::-1]
        return path

    graph = Graph()
    data = inputValue['data']
    i = 0
    for d in data:
        print("count: ", i)
        node = re.split('->|,', d)
        graph.add_node(node[0])
        graph.add_node(node[1])
        graph.add_edge(node[0], node[1], int(node[2]))
        i+=1


    sender = inputValue['sender']
    recipient = inputValue['recipient']
    answer = dijsktra(graph, sender, recipient)
    # print("input graph: ", inputValue)
    return {'result':answer}

